	private static String encodeSHA256(String inputString) throws NoSuchAlgorithmException, UnsupportedEncodingException {
		String checkSum = null;
    	if (StringUtils.isNotBlank(inputString)) {
    		inputString = inputString.trim();
    		MessageDigest messageDigest = MessageDigest.getInstance("SHA-256"); //"MD5");//"
    		messageDigest.reset();
			byte origData[] = inputString.getBytes("UTF-8");			
			messageDigest.update(origData);
			byte byteData[] = messageDigest.digest();
			// convert the byte to hex format method 1
			StringBuffer sb = new StringBuffer();
			for (int i = 0; i < byteData.length; i++) {
				//sb.append(Integer.toString((byteData[i] & 0xff) + 0x100, 16).substring(1));
				sb.append(String.format("%02X", byteData[i] & 0xFF));
			}
			checkSum = sb.toString();
		}
    	return checkSum;
	}
	
	private String bytesToHex(byte[] inBytes) {
		StringBuffer sb = new StringBuffer();
		BigInteger bi = new BigInteger(1, inBytes);
	    sb.append(String.format("%0" + (inBytes.length << 1) + "X", bi));
		return sb.toString();
	}
	
	private static byte[] hexStringToByteArray(String s) {
	    int len = s.length();
	    byte[] data = new byte[len / 2];
	    for (int i = 0; i < len; i += 2) {
	        data[i / 2] = (byte) ((Character.digit(s.charAt(i), 16) << 4)
	                             + Character.digit(s.charAt(i+1), 16));
	    }
	    return data;
	}
	
